        import oracle.odi.domain.model.OdiDataStore
        import oracle.odi.domain.mapping.exception.MappingException
        import oracle.odi.km.exception.OdiKMException

        public class LKM_SQL_to_ADWC_Copy_Direct extends LKM_File_to_ADWC_Copy_Direct {

                protected String sqlText;
                protected String tempDirectory;
                protected String tempFile;
                protected String srcDriver;
                protected String srcUrl;
                protected String srcUser;
                protected String srcPass;
                protected String tgtFormat;
                protected String tgtFieldSep;
                protected String tgtRowSep;
                protected String dateFormat;
	        protected String timeFormat;
                protected String charSet;
                protected String fetchSize;

                public void setBinding(Binding binding) {

                    super.setBinding(binding);

                    Map variables = binding.getVariables();

                    def tempSchema = getOptionValue("TEMP_FILE_SCHEMA")
                    if (tempSchema == null || tempSchema == "") {
                       throw new OdiKMException( "TEMP_FILE_SCHEMA option cannot be empty.");
                    }

                    tempDirectory = '<%=odiRef.getObjectName("L", "", "' + tempSchema + '", "D")%>';
                    binding.setVariable("tempDirectory", tempDirectory);

                    workDirectory = '<%=odiRef.getObjectName("L", "", "' + tempSchema + '", "W")%>';
                    binding.setVariable("workDirectory", workDirectory);

		    String fieldSeparatorOption = getOptionValue("FIELD_SEPARATOR");

                    tgtFormat = "VARIABLE";

		    if (fieldSeparatorOption == null || fieldSeparatorOption.equals("")) {
		      tgtFieldSep = ",";
		    } else {
		      tgtFieldSep = fieldSeparatorOption;
		      fileFormat = "D";
		      fieldSeparator = fieldSeparatorOption;
		    }
                    tgtRowSep = "\r\n";
                    tempFile = getResourceName(sourceNode);

                    binding.setVariable("tempFile", tempFile);

                    binding.setVariable("fileSchema", tempSchema);
                    binding.setVariable("resourceList", [tempFile]);
                    binding.setVariable("tgtFormat", tgtFormat);
                    binding.setVariable("tgtFieldSep", tgtFieldSep);
                    binding.setVariable("tgtRowSep", tgtRowSep);

                    srcDriver = '<?=odiRef.getInfo("SRC_JAVA_DRIVER")?>';
                    binding.setVariable("srcDriver", srcDriver);

                    srcUrl = '<?=odiRef.getInfo("SRC_JAVA_URL")?>';
                    binding.setVariable("srcUrl", srcUrl);

                    srcUser = '<?=odiRef.getInfo("SRC_USER_NAME")?>';
                    binding.setVariable("srcUser", srcUser);

                    srcPass = '<?=odiRef.getInfo("SRC_ENCODED_PASS")?>';
                    binding.setVariable("srcPass", srcPass);

                    dateFormat = getOptionValue("UNLOAD_DATE_FORMAT");
                    if (dateFormat == null) { dateFormat = ""; }
                    binding.setVariable("dateFormat", dateFormat);

                    timeFormat = getOptionValue("UNLOAD_TIMESTAMP_FORMAT");
                    if (timeFormat == null) { timeFormat = ""; }
                    binding.setVariable("timeFormat", timeFormat);

                    charSet = getOptionValue("CHARSET_ENCODING");
                    binding.setVariable("charSet", charSet);

                    fetchSize = getOptionValue("FETCH_SIZE");
                    binding.setVariable("fetchSize", fetchSize);

                    if (variables['subtype'] == "INSERT") {
                       def uploadQuery = buildUploadQueryDirect(generatorContext.getInputQuery())
                       if (uploadQuery != null) {
                          sqlText = uploadQuery.getText(getSourceNode().getTemplateUtils())
                       } else {
                          sqlText = ""
                       }
                    }

                    binding.setVariable("sqlText", sqlText);

                    if (addCompression) {
                      def sourceDirectory = tempDirectory;

                      compressDirectory = sourceDirectory;
                      binding.setVariable("compressDirectory", compressDirectory);

                      resourceList = compressedList;
                      binding.setVariable("resourceList", resourceList);

                      binding.setVariable("keepSources", 'false');
                    }
                }
            }
